import Nav from '../src/components/nav'
import { createGlobalStyle } from 'styled-components'

const Home = () => (
    <div >
        <Nav></Nav>
    </div>
)

const GlobalStyle = createGlobalStyle`
  body {
    background: #000;
    color: #fff;
  }
`;

export default Home
